import ProductImg from 'assets/images/product.png';

const ProductCard = () => {

  return (
    <div className="base-card product-card">
      <div>
        <img src={ProductImg} alt="Nome do produto" />
     
      </div>
      <div>
        <h6>Nome do produto</h6>
        <p>2345.6</p>

      </div>
    </div>

  );
}

export default ProductCard;
